import ProductItem from "./ProductItems";
import "./products.css"
function Product() {
  return (
    <div className="products">
      <ProductItem></ProductItem>
      <ProductItem></ProductItem>
      <ProductItem></ProductItem>
      <ProductItem></ProductItem>
    </div>
  );
}

export default Product ;
